description:
This is a Surround Sound sample DVD-Video/DVD-Audio hybrid disc.  It is an ISO image that can be burnt to a DVD+/-R.  It contains 3 songs each having been encoded in Dolby Pro Logic II, Dolby Digital, DTS, and MLP.  It will allow you to hear the differences between all 4 surround sound formats.

In order to hear the uncompressed MLP surround sound audio tracks you\&amp;#039;ll need to play the disc in a player that supports DVD-Audio. 

